import { instance } from '..'

export const getMember = async (offset: number, keyword: string) => {
  try {
    const response = await instance.get('administrators/churchs/member/', {
      params: { offset, keyword },
    })
    return response.data
  } catch (error) {
    console.error(error)
  }
}
